import React, { useEffect, useState } from 'react';

function App() {
  const [scheduleData, setScheduleData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/api/scheduling_decisions')
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => setScheduleData(data))
      .catch((error) => setError(error.message));
  }, []);

  if (error) {
    return <div>Error fetching scheduling data: {error}</div>;
  }

  if (!scheduleData) {
    return <div>Loading scheduling data...</div>;
  }

  return (
    <div>
      <h1>Scheduling Decisions</h1>
      <ul>
        {scheduleData.map((item) => (
          <li key={item.taskId}>
            Task {item.taskId} assigned to Node {item.nodeId} - Energy: {item.energy}W, Temp: {item.temperature}Â°C
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
